<script>
  document.addEventListener('DOMContentLoaded', function() {
    $('.all-peru__button').click(function(){
      var id = $(this).data('id')
      $('#'+id).addClass('active')
      $('#'+id).siblings().removeClass('active')
      $('body').css('overflow','hidden')
    })

    $('.overlayLocation').click(function(){
      $('.modal-location').removeClass('active')
      $('body').css('overflow','initial')

    })
    $('.closeModalLocation').click(function(){
      $('.modal-location').removeClass('active')
      $('body').css('overflow','initial')

    })
  })
</script>

<script>
  document.addEventListener("DOMContentLoaded", function(){
    document.querySelectorAll('.pathHover').forEach(function(path){
      const id = path.id.replace('Map','')

      if(!document.getElementById(id)){
        return path.classList.add('disabled')
      }
      path.addEventListener('click', function(){
        const id = path.id.replace('Map','')
        $('#'+id).addClass('active')
      $('#'+id).siblings().removeClass('active')
      $('body').css('overflow','hidden')

      });

    });

  })

</script>